export const updateArray = (a: number[], b: number): number[] => {
  if (b === -1) {
    // If 'b' is -1, create a new array with only -1
    return [-1];
  }

  // Check if 'b' exists in the array
  const includesB = a.includes(b);

  if (includesB) {
    // If 'b' exists, remove it and check if -1 is the only item left
    const newArray = a.filter(item => item !== b);
    if (
      newArray.length === 0 ||
      (newArray.length === 1 && newArray[0] === -1)
    ) {
      return [-1];
    }
    return newArray;
  }

  // If 'b' doesn't exist, add it to the array and check if -1 is already there
  const newArray = [...a, b];
  if (newArray.includes(-1)) {
    return newArray.filter(item => item !== -1);
  }

  return newArray;
};

export const isCurrentDate = (date: string): boolean => {
  // Create a Date object for the current date
  const currentDate = new Date();

  // Create a Date object for the date you want to compare
  const targetDate = new Date(date);

  // Compare the two dates
  if (
    currentDate.getFullYear() === targetDate.getFullYear() &&
    currentDate.getMonth() === targetDate.getMonth() &&
    currentDate.getDate() === targetDate.getDate()
  ) {
    console.log('The target date is equal to the current date.');
    return true;
  } else {
    console.log('The target date is not equal to the current date.');
    return false;
  }
};

export const formatTime = (seconds: number) => {
  const minutes = Math.floor(seconds / 60);
  const remainingSeconds = seconds % 60;
  return `${minutes}:${remainingSeconds < 10 ? '0' : ''}${remainingSeconds}`;
};


export const delayExecution = (callback : any, timeout : any) => {
  const timeoutId = setTimeout(callback, timeout);

  // Return a cancellation function
  return () => {
    clearTimeout(timeoutId);
  };
};

export const handleWebViewLinks = (request:any) => {
  // Check if the request is for an anchor tag or an external link.
  const url = request.url.toLowerCase();
  if (url.startsWith('http://') || url.startsWith('https://')) {
    // If it's an external link, open it in the device's default browser.
    Linking.openURL(request.url);
    return false; // Prevent the WebView from loading the link.
  }
  // Allow other requests to load within the WebView.
  return true;
};

export const generateAssetFontCss = ({
  fontFileName,
  extension = 'ttf',
}: {
  fontFileName: string;
  extension?: string;
}) => {
  const fileUri = Platform.select({
    ios: `${fontFileName}.${extension}`,
    android: `file:///android_asset/fonts/${fontFileName}.${extension}`,
  });

  return `@font-face {
      font-family: '${fontFileName}';
      src: local('${fontFileName}'), url('${fileUri}') ;
  }`;
};

