export const getCenter = () => {
  // Get the window dimensions
  const windowWidth = WINDOW_WIDTH;
  const windowHeight = WINDOW_HEIGHT;

  // Define the heights of the top app bar and bottom navigation
  const topAppBarHeight = 56; // Adjust this value according to your app's design
  const bottomNavHeight = 56; // Adjust this value according to your app's design

  // Calculate the center
  const centerX = windowWidth / 2;
  const centerY =
    (windowHeight - topAppBarHeight - bottomNavHeight) / 2 + topAppBarHeight;

  return {centerX, centerY};
};

